											<div className={styles[element]} key={key}>
												<p>{dictionary.get(element)}</p>
												<a onClick={(e) =>setEsponjaBody(esponjaBody.filter((bodyPart: string) => bodyPart != element))}>&times;</a>
											</div>
										)
									})}
									{esponjaBody.length < 4 && (
