								</div>

								<div className={styles.graph}>
									<Data data={esponjaMeasurements}></Data>
								</div>
							</div>
						</article>

						{/*<div className={styles.add}>
                        <button>+</button>
                    </div>*/}
					</div>
				</section>
			</div>
		</Dashboard>
	);
